import PropTypes from "prop-types";
import {
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import { MyActions, MyCard, MyTypography, MyButton} from "./PlacesCardStyles";

export default function PlacesCard({ place }) {
  return (
    <MyCard>
      <CardContent padding="5px">

        <CardMedia
          component="img"
          height="240"
          width="240"
          image={place.strDrinkThumb}
          alt="imagen del lugar"
        />

        <Typography name="nombreLugar" gutterBottom variant="h6" component="div">
          {place.strDrink}
        </Typography>

        <Typography name="direccionLugar" gutterBottom variant="caption" component="div">
          {place.strCategory}
        </Typography>

        <MyTypography name="descripcionLugar" variant="caption"  color="text.secondary">
          {place.strInstructionsES}
        </MyTypography>

      </CardContent>

      <MyActions>
        <MyButton size="small" color="primary">
          Ver comentarios
        </MyButton>
      </MyActions>

    </MyCard>
  );
}

PlacesCard.propTypes = {
  place: PropTypes.shape([]).isRequired,
};
